import { createContext } from "react";
import { products as productData } from "./products"; // import your products array

export const ShopContaxt = createContext();

export const ShopContaxtProvider = ({ children }) => {
  const currency = '$';
  const dilivery_fee = '20';
  const products = productData; // make products available in context

  const value = {
    currency,
    dilivery_fee,
    products, // <-- add products here
  };

  return (
    <ShopContaxt.Provider value={value}>
      {children}
    </ShopContaxt.Provider>
  );
};
